import React, { useState, useEffect } from "react";
import axios from "axios";

function MedicineSearch() {
  const [query, setQuery] = useState("");
  const [suggestions, setSuggestions] = useState([]);
  const [selectedMedicine, setSelectedMedicine] = useState(null);

  useEffect(() => {
    if (!query) {
      setSuggestions([]);
      return;
    }
    const fetchData = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/medicines/search", {
          params: { q: query },
        });
        setSuggestions(res.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchData();
  }, [query]);

  const handleSelect = (med) => {
    setSelectedMedicine(med);
    setQuery(med.name);
    setSuggestions([]);
  };

  return (
    <div style={{ maxWidth: "700px", margin: "30px auto", padding: "20px", borderRadius: "12px", background: "#f4f9ff" }}>
      <input
        type="text"
        placeholder="Search by name, category, or symptom..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        style={{ width: "100%", padding: "12px", borderRadius: "8px", border: "1px solid #007bff", outline: "none" }}
      />
      {suggestions.length > 0 && (
        <ul style={{ listStyle: "none", padding: 0, marginTop: "5px", border: "1px solid #ddd", borderRadius: "8px", background: "white" }}>
          {suggestions.map((med) => (
            <li key={med._id} onClick={() => handleSelect(med)} style={{ padding: "10px", cursor: "pointer" }}>
              {med.name} ({med.category}) {med.symptoms && med.symptoms.join(", ")}
            </li>
          ))}
        </ul>
      )}
      {selectedMedicine && (
        <div style={{ marginTop: "20px", padding: "15px", border: "1px solid #ccc", borderRadius: "10px", background: "white" }}>
          <h3>{selectedMedicine.name}</h3>
          <p><strong>Category:</strong> {selectedMedicine.category}</p>
          <p><strong>Symptoms:</strong> {selectedMedicine.symptoms && selectedMedicine.symptoms.join(", ")}</p>
          <p><strong>Price:</strong> {selectedMedicine.price}â‚¹</p>
        </div>
      )}
    </div>
  );
}

export default MedicineSearch;
